(5860, 1350, 0, 4, '我的寶貝 SV', 'Special Version for 私人收藏 僅供試聽', '0000-00-00 00:00:00', 0000, 0, 2, 7, '夜空裡 像星星 是你眨呀眨的眼睛\r\n望著你 深呼吸 你的笑浸蝕我的心\r\n\r\n迷惘天際 溫暖雙手 融化了我心中冰冷\r\n傻傻 跟我\r\n\r\n我的寶貝 永遠一起 手牽著手 我會愛你 愛你\r\n我的寶貝 永遠一起 手牽著手 我會愛你 愛你\r\n', '', 244, '', '滾滾熊他爸', '滾滾熊他爸&奈米', 'ナナミ滾滾熊 ', '霓虹木工作室(Rainbow Wood Studio)', '', 0, 0, 0, '2008-06-15 17:17:47', '2015-03-12 13:33:12', '0000-00-00 00:00:00'),
(5861, 315, 0, 1, 'At The Factory', '過去曾花了一年的時間在工廠工作\r\n\r\nCome Round - Stickboy (UK)\r\nThe Last Mosquito Fight Of Sumer - Lorna (UK)\r\nPeople Are Talking, What I Love The Most  - Beat Radio (US)\r\nLittle Lover''s So Polite - Silversun Pickups (US)\r\nThe Build Up - Kings Of Convenience (Norway)\r\n\r\n這些歌讓我渡過了無趣勞累的一年', '0000-00-00 00:00:00', 0000, 15, 1, 7, 'Yes, I remember\r\nThat I spent one year\r\nWorking at the factory\r\nAnd now the songs keep going\r\nReminding me the days\r\nThey used to pulled me up\r\nThey used to warm me\r\n\r\nCome Round, Stickboy''s gentle sounds\r\nThe Last Mosquito Fight Of Summer\r\nAlways made me feel so hight\r\nPeople Are Talking\r\nWhat I Love The Most\r\nLittle Lover''s So Polite\r\nLittle Lover''s So Polite\r\nLittle Lover''s So Polite\r\nThe Build Up\r\nI''m wondering when to get off', '', 436, '', 'Ever', 'Ever', '', '', '', 0, 0, 1, '2008-06-17 05:01:07', '2013-10-07 17:12:35', '0000-00-00 00:00:00'),
(5862, 315, 0, 2, 'But Pogo Isn''t My Destiny', '當你總是想要變成別人\r\n一下想變成甲\r\n一下又想變成乙\r\n\r\n到最後發現誰也當不成\r\n但最糟糕的是\r\n不但誰也當不成\r\n還發現你根本不知道自己是什麼樣子\r\n不是因為不知道自己是什麼樣子\r\n而是因為總是想著要變成別人\r\n而還沒有想過自己究竟是什麼樣子', '2010-02-18 00:00:00', 0000, 0, 1, 7, '並不是真要討你開心？而我所能做的就只是這些而已\r\n唱著你的歌　假裝很厲害的樣子\r\n\r\n並不是真要迎合你？而我所能做的就只有這些而已\r\n寫首歌送給你　假裝很深情的樣子\r\n\r\nBut I know Pogo is not my destiny...\r\nBut I know Pogo, I know Pogo...\r\n\r\n並不是真要取悅你？而我所能做的就只有這些而已\r\n靜靜的看著你　希望你會發現\r\n並不是真要取悅你？而我所能做的就只有這些而已\r\n靜靜的看著你　卻忘記了迷戀我自己\r\n\r\nBut I know Pogo is not my destiny...\r\nBut I know Pogo, I know Pogo...', '', 223, '', 'Ever', 'Ever', '', '', '', 0, 1, 0, '2008-06-17 05:15:22', '2015-03-12 13:33:12', '0000-00-00 00:00:00'),
