(5900, 2419, 707, 1, '城市裡那麼多的人', '', '2005-12-01 00:00:00', 0000, 20, 0, 6, '', '作詞：謝銘祐\n作曲：謝銘祐\n編曲：謝銘祐\n\n太陽吹起了起床號 　Come on 螞蟻雄兵啊 往前方模糊的目標\nBye-bye 門口的愛人們 Baby 未來長怎樣 找時間我會想一想\n手中的地圖密密又麻麻 所有的城市都躺在相同的古老天空下\n\n城市裡那麼多的車 城市裡那麼多的人 呼嘯著擁擠的陌生\n城市裡那麼多的錢 城市裡那麼多的人 拼老命追著慾望啃\n原來啊我們真的是 凡人\n\n有線落伍了換無線 衛星指揮著一切 台北的隔壁是紐約\n貼上背不完的標籤 Hello　親愛的鄰居 到底啊 何時見一面\n手中的地圖密密又麻麻 所有的城市都躺在相同的古老天空下\n\n城市裡那麼多的歌 城市裡那麼多的人 傳頌著謊言的冰冷\n城市裡那麼多的神 城市裡那麼多的人 保祐誰贏得了永恆\n原麼來啊我們真的是 凡人\n\n每天要記得微笑記得快樂記得去愛身邊的人\n那得先忘了眼淚忘了痛苦忘了對他累積的恨\n該找誰給個地方給個明天給個屬於你的自己\n那麼多人 那麼多人 那麼多人咬人\n\n城市裡那麼多的夢 城市裡那麼多的人 卻只能有一個人生\n城市裡那麼多的手 城市裡那麼多的人 每次擁抱都不單純\n原來啊我們真的是 凡人 很榮幸陪大家一起 打滾', 339, '', '', '', '', '', '', 1, 1, 0, '2008-06-19 11:48:55', '2015-03-12 13:33:13', '0000-00-00 00:00:00'),
(5901, 2419, 707, 2, '嘿嘿嘿', '', '2005-12-01 00:00:00', 0000, 20, 0, 6, '', '\n作詞：謝銘祐\n作曲：謝銘祐\n編曲：洪晟文\n\n老貓又在鋼琴上昏倒 上流井底蛙明日登台 熱線你和我燒了起來\n他正買下你的風流債 分身的本尊剛剛離開 傳說中的我唇紅齒白\n嘿嘿 嘿嘿\n\n拉上我嘴巴上的拉鍊　你一轉身馬上有風險　衛星陪簡訊環遊世界\n被告原告誰管誰誣告　怎麼判都糢糊的兩造　真相聽說還在睡大覺\n嘿嘿　嘿嘿\n\n我在謠言的草原奔跑 上頭狐疑的烏雲籠罩 一眨眼就有一埸風暴\n每個人一肚子沒証據的真理　狗血灑滿了半句標題\n別管搖擺不定的心跳 快跟著呼吸 嘿嘿\n\n我在謠言的草原奔跑 上頭狐疑的烏雲籠罩 一眨眼就有一埸風暴\n每個人一肚子沒証據的真理 狗血灑滿了半句標題\n別管搖擺不定的心跳　快跟著呼吸\n耳朵立正站好 又有人在哭夭\n嘿嘿嘿　嘿嘿嘿', 187, '', '', '', '', '', '', 1, 1, 0, '2008-06-19 11:49:23', '2015-03-12 13:33:13', '0000-00-00 00:00:00'),
(5902, 2419, 707, 3, '不鳥族', '', '2005-12-01 00:00:00', 0000, 20, 0, 6, '', '作詞：謝銘祐\n作曲：謝銘祐\n編曲：蔡政勳\n\n右手插右褲袋　有檳榔妹在左邊　我的造型　復古　辣昧\n自由了十五天　網咖裏這一大堆\n和我一樣頹廢　凡我族人不要貪睡\n\n白天接黑夜　快換個情人來接上一位\n青春過短別浪費　起飛　快丟掉時間\n\n不鳥亂飛　不可理喻不知所云不分晝夜　Fly away\n如果我的眼中看不見你　這場遊戲怠慢了　你很抱歡\n飛進不鳥王國　不痛不癢不聞不問不理不睬我就是世界\n回到久違的巢　守著翅膀不睡\n\nMinako緊盯著　開Jaguar的凱子爺　股溝乳溝　Come on　baby\n嘻哈幫大侵略　大小不鳥學著點\n說話盡量要黑　凡我族人不要貪唾\n\n你是幾年級　預支快樂沒有年齡上限\n真情很貴別付現　起飛　快丟掉峙間\n\n不鳥亂飛不可理喻不知所云不分晝夜Fly away\n如果我的眼中看不見你這場遊戲怠慢了你很抱歉\n飛進不鳥王國不痛不癢不聞不問不理不睬我就是世界\n回到久違的巢　收起翅膀不唾\n\n快撐開黑眼圈　你快撐開黑眼圈　快丟掉時間\n(快撐開黑眼圈　你快撐開黑眼圈　起飛　起飛) 快丟掉\n', 240, '', '', '', '', '', '', 1, 1, 0, '2008-06-19 11:49:55', '2015-03-12 13:33:13', '0000-00-00 00:00:00'),
(5903, 2419, 707, 4, '嗚', '', '2005-12-01 00:00:00', 0000, 20, 0, 6, '', '嗚\n\n作詞：謝銘祐\n作曲：謝銘祐\n編曲：王東昇\n\n主耶穌或是阿彌陀佛　隨便選一個反正你不清楚\n養小鬼財神來自五路　生起一堆火你就跟著我嗚\n嗚～\n\n有輪迴別當獅子老虎　人的戰場裡你會沒有生路\n貪幸福要裝很多痛苦　反正都是輸你就跟著我哭\n嗚～\n\n刷爆它快樂趕快預支　明天會怎樣是另一個故事\n往上爬讓人覺得可惡　想要成大事你就跟著我讀\n嗚～\n\n管它規則　管它道德　管它毒不毒\n打開眼睛　打開耳朵　打開不滿足\n人神共怒　嚇嚇孩子　放下歷史書\n審不審判　時間一到　還是入了土\n嗚～太辛苦　活著本來就苦\n一把大爛牌　也有可能會胡', 194, '', '', '', '', '', '', 1, 1, 0, '2008-06-19 11:50:23', '2015-03-12 13:33:13', '0000-00-00 00:00:00'),
(5904, 2419, 707, 5, '不夜', '', '2005-12-01 00:00:00', 0000, 20, 0, 6, '', '\n作詞：謝銘祐\n作曲：謝銘祐\n編曲：呂錦盈\n\n今晚寂寞嗎Honey　要到哪裡玩Honey\n我和你一樣Honey　找一副身軀\n口袋還有點Money　就是缺了點Funny\n誰是今晚的Bunny　Somebody sets me free\n\n慾望錢買得到　但感情買不起\n魔鬼躲在哪裡　救個急\n打開不夜的門　重複活死人的遊戲\n披著茫然的皮　別承認\nParty不夜的人　微笑扛起你的寂寞\n靈魂一斤　值多少別問\n\n你也醉了嗎Honey　還有節目嗎Honey\n想抱就抱吧Honey　Mary or Jenny\n疏遠又擁擠這裡　可愛又可恨這裡\n別再提醒我這裡　等明天再繼續\n\n慾望錢買得到　但感情買不起\n魔鬼躲在哪裡　救個急\n打開不夜的門　重複活死人的遊戲\n披著茫然的皮　別承認\nParty不夜的人　微笑扛起你的寂寞\n靈魂一斤　值多少別問\n\n今晚寂寞嗎Honey　要到哪裡玩Honey\n你也醉了嗎Honey\n', 290, '', '', '', '', '', '', 1, 1, 0, '2008-06-19 11:51:01', '2015-03-12 13:33:13', '0000-00-00 00:00:00'),
(5905, 2419, 707, 6, 'Rain For A City', '', '2005-12-01 00:00:00', 0000, 20, 0, 6, '', '作詞：謝銘祐\n作曲：謝銘祐\n編曲：洪晟文/朱源輝/謝銘祐\n\n來了場雨 伸伸懶腰 洗個身體\n夏日午后 悶壞的Down town 車子們塞滿我的肚皮\n交頭接耳 南風催著 牆的皺紋\n東邊的街 又穿上鋼骨衣\n昨天的夢正搭著電梯 刷時間的油漆\n\nHello Hello 要留 要走 經過我不休息\nHello Hello 是樂園或地獄 這裡的規矩是各自努力\n\nHello Hello 要哭 要笑 沈默我陪著你\nHello Hello 雨慢慢停下來 打開時光口袋大口呼吸\n\n樓塌了樓又蓋了 人來了人又走了\n你說著你的夢想 他沿著邊緣流浪\n都歡迎 歡迎\n披上夜衣 霓虹舞會 就要開始 你的腳步隨你', 250, '', '', '', '', '', '', 1, 1, 0, '2008-06-19 11:51:34', '2015-03-12 13:33:13', '0000-00-00 00:00:00'),
