(5907, 2419, 707, 8, 'Rock Rock Saturday Night', '', '2005-12-01 00:00:00', 0000, 20, 0, 6, '', '作詞：謝銘祐\n作曲：謝銘祐\n編曲：呂錦盈\n\nTony已經抽完了身上的煙　他說的馬子Sherry還是沒露臉\n其他的人都蹭在獵物身邊　誰唬誰　誰管誰　的謊言\n\nSunny在廁所裡面吐了三遍　頭又拖著陳桑猛嗑了一杯\n每一個人都眼中閃著火焰　周末夜　要忘記　你是誰\n\nRock Rock Saturday night　把自己看好\nRock Rock Saturday night　把寂寞餵飽\nRock Rock Saturday night　別急著落跑\n下一秒就要變老\n\nYoko將標靶當成老闆的臉　對Johnny說的八卦完全不理會\n沒事的人還繼續找著寶貝　周末夜　誰記得你是誰', 175, '', '', '', '', '', '', 1, 1, 0, '2008-06-19 11:52:29', '2015-03-12 13:33:13', '0000-00-00 00:00:00'),
