(5911, 2419, 707, 12, '陽台10f之1黃昏', '', '2005-12-01 00:00:00', 0000, 20, 0, 6, '', '微涼落日 咖啡 陽台有綠仙人掌 躺椅與我\n混亂堆積 在沈澱之後 我伸一伸懶腰\n\n城市Ａ 靠海的十樓陽台上\n我將歲月中 那些遺憾風乾\n已作廢 和沒放手的藏寶圖\n半生 汗漬 旅途\n青春 愛人 故事 先收在夢的箱子 Good bye\n\n城市Ｂ 另一座十樓陽台上\n謝銘祐 陽台10F之1黃昏 Lyrics\n誰在黃昏裏 折疊疲累的心\n唱首歌 倒一點圾垃給世界\n陪著 太陽 歇會\n\n孤單 明天 日子 　陌生的昨天的我 Good-bye', 141, '', '', '', '', '', '', 1, 1, 0, '2008-06-19 11:54:41', '2015-03-12 13:33:13', '0000-00-00 00:00:00'),
