(5951, 794, 712, 1, 'Spain Dentist', '', '2008-06-20 00:00:00', 0000, 0, 2, 7, '西班牙醫不停煩惱著\r\n這樣的藥該怎麼賣\r\n這裡的人們總是哀嘆著\r\n該信仰什麼才能得到快樂\r\n\r\nSpain dentist is working every time\r\nHe is a glutton for every wonderful\r\nYou start the conversation every night\r\nMaybe white capsule can make you feel alive\r\n\r\n西班牙醫不停思考著 在迷宮裡該怎樣選擇\r\n無題的電影不停描寫著 描寫那些不知所云的人們\r\n\r\n昨夜伏特加浸泡的味蕾 似乎還殘留柑橘的香甜\r\n聚光燈照射產生了暈眩 麻醉所有停格的畫面\r\n柑橘的香甜 花朵的暈眩\r\n如果你錯過了 那麼就重來一遍\r\n\r\n屏幕依然在閃動卻沒有任何保留\r\n西班牙醫突然發覺自己在屏幕中閃動 , 在閃動', '', 265, '蚊子大象', '彭致穎', '彭致穎', '', '', '', 1, 0, 0, '2008-05-14 14:51:54', '2015-03-12 13:33:15', '0000-00-00 00:00:00'),
(5952, 320, 712, 2, '下北澤的保密防諜', '', '2008-06-20 00:00:00', 0000, 0, 2, 7, '私鐵 人群 商店街的叫賣\r\n廣島燒的快手多桑\r\n牆上的喇叭唱著英國腔\r\nOh Beatles, wanna hold your hand\r\n\r\n街燈在打光 少年彈唱告白\r\n手指框架聚焦 沉醉在你的浪漫\r\n\r\nWe listen, We feel, We can\r\nTouched by\r\nyour word, your sound, your move\r\nYou move us to the sky\r\nAnd rise, and fall, thank you\r\n\r\n步道 情侶 Oshara的櫥窗\r\n章魚燒的Kirei卡桑\r\n牆上海報的Strato在燃燒\r\nOh Jimi , FIRE !!!\r\n\r\n街燈在打光 少女街頭劇場\r\n手指框架聚焦 你的羞澀對白\r\n\r\nWe listen, We feel, We can\r\nTouched by\r\nyour word, your sound, your move\r\nYou move us to the sky,\r\nAnd rise, and fall, thank you\r\n', '', 265, 'Zag Lope', '早尊', '早尊', ' Zag Lope', 'Zag Lope', '', 1, 0, 0, '2008-05-26 11:27:50', '2015-03-12 13:33:15', '0000-00-00 00:00:00'),
