(5976, 297, 715, 2, '青春輓歌 (demo)', '', '2008-04-23 00:00:00', 0000, 0, 2, 1, '寫完最後一道習題 向晚微風吹起\r\n我披上外衣 啟程迎戰假想敵\r\n書包裡裝滿著課本講義 擔心著待會的隨堂練習\r\n我想我應該不會是最後一名\r\n電車上的男女 都跟我差不多年紀\r\n他們多半面無表情 要不就是埋頭努力\r\n　\r\n我們的青春 都過的太急\r\n花太多時間證明 三角函數和人生的邏輯\r\n我們的青春 都過的太急\r\n錯過的列車揚長而去\r\n還來不及吹起你的百摺裙', '', 271, 'Finn', '黃士勛', '黃士勛', '', '', '', 0, 0, 1, '2008-04-23 13:29:04', '2013-10-07 17:12:36', '0000-00-00 00:00:00'),
