(5978, 642, 715, 4, '愛的大逃殺', '', '2008-04-05 00:00:00', 0000, 0, 2, 7, '再清晨四點騎著摩托車到你家門口\r\n我承認再那之前我有喝了一點啤酒\r\n可是到了你家卻沒有按門鈴的勇氣\r\n我問我自己到底再搞些什麼東西啊\r\n眼淚留下來啦！鼻涕留下來啦！\r\n還是算了吧！\r\n於是我跑到你家附近的豆漿店\r\n我叫了一堆食物好讓自己發發脾氣\r\n我點了饅頭加蛋燒餅油條一盤蛋餅\r\n我一口兩口三口四口吃的大呼過癮啊！\r\n眼淚留下來啦！鼻涕留下來啦！\r\n還是算了吧！\r\n\r\n我討厭自己太自作多情\r\n我討厭沈默和無能為力,就是你\r\n我要看著你的眼睛告訴你我所有的祕密\r\n站在你的面前然後想些完美的話題\r\n就算變得一無所有我也算沒關係\r\n知道為什麼嗎?\r\n因為我要走啦！\r\n要走啦！\r\n我要逃走啦！', '', 264, '雀斑', '斑斑', '斑斑', '雀斑', 'Unwritten', '', 0, 0, 1, '2008-04-14 13:14:39', '2013-10-07 17:12:36', '0000-00-00 00:00:00'),
